package String.problems;

public class PalindromeDeleteOneChar {

    public static void main(String[] args) {
        //String input = "cdbeeeabddddbaeedebdc";
        //String input = "ebcbbececabbacecbbcbe";

        // Approach String Builder or String
        String input = "abc";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "aba";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "abca";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "eedede";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "eccer";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "pidbliassaqozokmtgahluruufwbjdtayuhbxwoicviygilgzduudzgligyviciowxbhuyatdjbwfuurulhagtmkozoqassailbdip";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "aydmda";
        System.out.println(input + " > " + validPalindrome_ByDeletingEachChar(input));
        System.out.println(input + " > " + usingRecursion(input));

        input = "";
        //System.out.println(validPalindrome_ByDeletingEachChar(input) + " > " + input);
        System.out.println(" > " + usingRecursion(input));

    }

    /**
     * Recursion: O(n)
     */
    public static boolean usingRecursion(String s) {

        if (s.length() < 3)
            return true;

        return isValidPalindrome(s, 0, s.length() - 1);

    }

    public static boolean isValidPalindrome(String s, int i, int j) {

        if(i >= j){
            return true;
        }

        if (s.charAt(i) == s.charAt(j)) {
            //System.out.println(s.charAt(i + 1) + " > " + s.charAt(j - 1));
            return isValidPalindrome(s, i + 1, j - 1);
        } else {

            // Remove string from left side and check if palindrome
            if (isPalindrome(s.substring(i + 1, j+1))) {
                return true;
            }

            // Remove string from right side and check if palindrome
            if (isPalindrome(s.substring(i, j))) {
                return true;
            }

            return false;
        }
    }

    /**
     * TC : O(n2)
     */
    public static boolean validPalindrome_ByDeletingEachChar(String s) {

        if (s.length() < 3)
            return true;

        int i = 0;
        int len = s.length();
        StringBuilder sbr = new StringBuilder();

        if (isPalindrome(s)) {
            return true;
        }

        while (i <= len) {

            sbr = new StringBuilder();

            if (i == 0) {
                sbr.append(s.substring(i + 1, len));
            } else if (i == len) {
                sbr.append(s.substring(0, len - 1));
            } else {
                sbr.append(s.substring(0, i));
                if (i + 1 < len)
                    sbr.append(s.substring(i + 1, len));
            }

            if (isPalindrome(sbr.toString())) {
                return true;
            } else {
                i = i + 1;
            }

        }

        return false;

    }

    public static boolean isPalindrome(String s) {
        StringBuilder sbr = new StringBuilder(s);
        sbr.reverse();
        return s.equals(sbr.toString());
    }


}
